aaa14396-90fe-4540-8952-c65afbfa442c	{"id": "aaa14396-90fe-4540-8952-c65afbfa442c", "appname": "realtime-dev.supabase-realtime", "metadata": {"level": "info", "project": "default", "external_id": "default"}, "timestamp": 1765546152577973, "event_message": "execute \\"create function realtime.subscription_check_filters()\\\\n      returns trigger\\\\n      language plpgsql\\\\n    as $$\\\\n    /*\\\\n    Validates that the user defined filters for a subscription:\\\\n    - refer to valid columns that 'authenticated' may access\\\\n    - values are coercable to the correct column type\\\\n    */\\\\n    declare\\\\n      col_names text[] = coalesce(\\\\n        array_agg(c.column_name order by c.ordinal_position),\\\\n        '{}'::text[]\\\\n      )\\\\n        from\\\\n          information_schema.columns c\\\\n        where\\\\n          (quote_ident(c.table_schema) || '.' || quote_ident(c.table_name))::regclass = new.entity\\\\n          and pg_catalog.has_column_privilege('authenticated', new.entity, c.column_name, 'SELECT');\\\\n      filter realtime.user_defined_filter;\\\\n      col_type text;\\\\n    begin\\\\n      for filter in select * from unnest(new.filters) loop\\\\n        -- Filtered column is valid\\\\n        if not filter.column_name = any(col_names) then\\\\n          raise exception 'invalid column for filter %', filter.column_name;\\\\n        end if;\\\\n\\\\n        -- Type is sanitized and safe for string interpolation\\\\n        col_type = (\\\\n          select atttypid::regtype\\\\n          from pg_catalog.pg_attribute\\\\n          where attrelid = new.entity\\\\n            and attname = filter.column_name\\\\n        )::text;\\\\n        if col_type is null then\\\\n          raise exception 'failed to lookup type for column %', filter.column_name;\\\\n        end if;\\\\n        -- raises an exception if value is not coercable to type\\\\n        perform format('select %s::%I', filter.value, col_type);\\\\n      end loop;\\\\n\\\\n      -- Apply consistent order to filters so the unique constraint on\\\\n      -- (user_id, entity, filters) can't be tricked by a different filter order\\\\n      new.filters = coalesce(\\\\n        array_agg(f order by f.column_name, f.op, f.value),\\\\n        '{}'\\\\n      ) from unnest(new.filters) f;\\\\n\\\\n      return new;\\\\n    end;\\\\n    $$;\\""}	execute "create function realtime.subscription_check_filters()\\n      returns trigger\\n      language plpgsql\\n    as $$\\n    /*\\n    Validates that the user defined filters for a subscription:\\n    - refer to valid columns that 'authenticated' may access\\n    - values are coercable to the correct column type\\n    */\\n    declare\\n      col_names text[] = coalesce(\\n        array_agg(c.column_name order by c.ordinal_position),\\n        '{}'::text[]\\n      )\\n        from\\n          information_schema.columns c\\n        where\\n          (quote_ident(c.table_schema) || '.' || quote_ident(c.table_name))::regclass = new.entity\\n          and pg_catalog.has_column_privilege('authenticated', new.entity, c.column_name, 'SELECT');\\n      filter realtime.user_defined_filter;\\n      col_type text;\\n    begin\\n      for filter in select * from unnest(new.filters) loop\\n        -- Filtered column is valid\\n        if not filter.column_name = any(col_names) then\\n          raise exception 'invalid column for filter %', filter.column_name;\\n        end if;\\n\\n        -- Type is sanitized and safe for string interpolation\\n        col_type = (\\n          select atttypid::regtype\\n          from pg_catalog.pg_attribute\\n          where attrelid = new.entity\\n            and attname = filter.column_name\\n        )::text;\\n        if col_type is null then\\n          raise exception 'failed to lookup type for column %', filter.column_name;\\n        end if;\\n        -- raises an exception if value is not coercable to type\\n        perform format('select %s::%I', filter.value, col_type);\\n      end loop;\\n\\n      -- Apply consistent order to filters so the unique constraint on\\n      -- (user_id, entity, filters) can't be tricked by a different filter order\\n      new.filters = coalesce(\\n        array_agg(f order by f.column_name, f.op, f.value),\\n        '{}'\\n      ) from unnest(new.filters) f;\\n\\n      return new;\\n    end;\\n    $$;"	2025-12-12 13:29:12.577973
