| entity || '\\n          where\\n            ' || string_agg(quote_ident(pkc.name) || '=' || quote_nullable(pkc.value) , ' and ') || '\\n        )'\\n      from\\n        unnest(columns) pkc\\n      where\\n        pkc.is_pkey\\n      group by\\n        entity\\n    $$;"	2025-12-12 13:29:15.065193
16030bf6-be12-438f-b392-43caf5211956	{"id": "16030bf6-be12-438f-b392-43caf5211956", "appname": "realtime-dev.supabase-realtime", "metadata": {"level": "info", "project": "default", "external_id": "default"}, "timestamp": 1765546155063806, "event_message": "execute \\"DO $$\\\\nBEGIN\\\\n    IF NOT EXISTS (SELECT 1 FROM pg_type WHERE typname = 'wal_column') THEN\\\\n        CREATE TYPE realtime.wal_column AS (\\\\n          name text,\\\\n          type text,\\\\n          value jsonb,\\\\n          is_pkey boolean,\\\\n          is_selectable boolean\\\\n        );\\\\n    END IF;\\\\nEND$$;\\\\n\\""}	execute "DO $$\\nBEGIN\\n    IF NOT EXISTS (SELECT 1 FROM pg_type WHERE typname = 'wal_column') THEN\\n        CREATE TYPE realtime.wal_column AS (\\n          name text,\\n          type text,\\n          value jsonb,\\n          is_pkey boolean,\\n          is_selectable boolean\\n        );\\n    END IF;\\nEND$$;\\n"	2025-12-12 13:29:15.063806
65d266da-65c9-407c-9d12-f917ed9bc190	{"id": "65d266da-65c9-407c-9d12-f917ed9bc190", "appname": "realtime-dev.supabase-realtime", "metadata": {"level": "info", "project": "default", "external_id": "default"}, "timestamp": 1765546156570190, "event_message": "execute \\"create function realtime.is_visible_through_filters(columns realtime.wal_column[], filters realtime.user_defined_filter[])\\\\n      returns bool\\\\n      language sql\\\\n      immutable\\\\n    as $$\\\\n    /*\\\\n    Should the record be visible (true) or filtered out (false) after *filters* are applied\\\\n    */\\\\n    select\\\\n      -- Default to allowed when no filters present\\\\n      coalesce(\\\\n        sum(\\\\n          realtime.check_equality_op(\\\\n            op:=f.op,\\\\n            type_:=col.type::regtype,\\\\n            -- cast jsonb to text\\\\n            val_1:=col.value #>> '{}',\\\\n            val_2:=f.value\\\\n          )::int\\\\n        ) = count(1),\\\\n        true\\\\n      )\\\\n    from\\\\n      unnest(filters) f\\\\n      join unnest(columns) col\\\\n          on f.column_name = col.name;\\\\n    $$;\\""}	execute "create function realtime.is_visible_through_filters(columns realtime.wal_column[], filters realtime.user_defined_filter[])\\n      returns bool\\n      language sql\\n      immutable\\n    as $$\\n    /*\\n    Should the record be visible (true) or filtered out (false) after *filters* are applied\\n    */\\n    select\\n      -- Default to allowed when no filters present\\n      coalesce(\\n        sum(\\n          realtime.check_equality_op(\\n            op:=f.op,\\n            type_:=col.type::regtype,\\n            -- cast jsonb to text\\n            val_1:=col.value #>> '{}',\\n            val_2:=f.value\\n          )::int\\n        ) = count(1),\\n        true\\n      )\\n    from\\n      unnest(filters) f\\n      join unnest(columns) col\\n          on f.column_name = col.name;\\n    $$;"	2025-12-12 13:29:16.57019
