f99f8ff9-73ad-444d-b2bb-391395e2c65a	{"id": "f99f8ff9-73ad-444d-b2bb-391395e2c65a", "appname": "realtime-dev.supabase-realtime", "metadata": {"level": "info", "project": "default", "external_id": "default"}, "timestamp": 1765546161664476, "event_message": "execute \\"create function realtime.to_regrole(role_name text)\\\\n      returns regrole\\\\n      immutable\\\\n      language sql\\\\n      -- required to allow use in generated clause\\\\n      as $$ select role_name::regrole $$;\\""}	execute "create function realtime.to_regrole(role_name text)\\n      returns regrole\\n      immutable\\n      language sql\\n      -- required to allow use in generated clause\\n      as $$ select role_name::regrole $$;"	2025-12-12 13:29:21.664476
44399866-f826-444f-a129-2343b58941ed	{"id": "44399866-f826-444f-a129-2343b58941ed", "appname": "realtime-dev.supabase-realtime", "metadata": {"level": "info", "project": "default", "external_id": "default"}, "timestamp": 1765546157387478, "event_message": "execute \\"create function realtime.apply_rls(wal jsonb, max_record_bytes int = 1024 * 1024)\\\\n      returns realtime.wal_rls\\\\n      language plpgsql\\\\n      volatile\\\\n    as $$\\\\n    declare\\\\n      -- Regclass of the table e.g. public.notes\\\\n      entity_ regclass = (quote_ident(wal ->> 'schema') || '.' || quote_ident(wal ->> 'table'))::regclass;\\\\n\\\\n      -- I, U, D, T: insert, update ...\\\\n      action realtime.action = (\\\\n        case wal ->> 'action'\\\\n          when 'I' then 'INSERT'\\\\n          when 'U' then 'UPDATE'\\\\n          when 'D' then 'DELETE'\\\\n          when 'T' then 'TRUNCATE'\\\\n          else 'ERROR'\\\\n        end\\\\n      );\\\\n\\\\n      -- Is row level security enabled for the table\\\\n      is_rls_enabled bool = relrowsecurity from pg_class where oid = entity_;\\\\n\\\\n      -- Subscription vars\\\\n      user_id uuid;\\\\n      email varchar(255);\\\\n      user_has_access bool;\\\\n      is_visible_to_user boolean;\\\\n      visible_to_user_ids uuid[] = '{}';\\\\n\\\\n      -- user subscriptions to the wal record's table\\\\n      subscriptions realtime.subscription[] =\\\\n        array_agg(sub)\\\\n        from\\\\n          realtime.subscription sub\\\\n        where\\\\n          sub.entity = entity_;\\\\n\\\\n      -- structured info for wal's columns\\\\n      columns realtime.wal_column[] =\\\\n        array_agg(\\\\n          (\\\\n            x->>'name',\\\\n            x->>'type',\\\\n            realtime.cast((x->'value') #>> '{}', (x->>'type')::regtype),\\\\n            (pks ->> 'name') is not null,\\\\n            pg_catalog.has_column_privilege('authenticated', entity_, x->>'name', 'SELECT')\\\\n          )::realtime.wal_column\\\\n        )\\\\n        from\\\\n          jsonb_array_elements(wal -> 'columns') x\\\\n          left join jsonb_array_elements(wal -> 'pk') pks\\\\n            on (x ->> 'name') = (pks ->> 'name');\\\\n\\\\n      -- previous identity values for update/delete\\\\n      old_columns realtime.wal_column[] =\\\\n        array_agg(\\\\n          (\\\\n            x->>'name',\\\\n            x->>'type',\\\\n            realtime.cast((x->'value') #>> '{}', (x->>'type')::regtype),\\\\n            (pks ->> 'name') is not null,\\\\n            pg_catalog.has_column_privilege('authenticated', entity_, x->>'name', 'SELECT')\\\\n          )::realtime.wal_column\\\\n        )\\\\n        from\\\\n          jsonb_array_elements(wal -> 'identity') x\\\\n          left join jsonb_array_elements(wal -> 'pk') pks\\\\n            on (x ->> 'name') = (pks ->> 'name');\\\\n\\\\n      output jsonb;\\\\n\\\\n      -- Error states\\\\n      error_record_exceeds_max_size boolean = octet_length(wal::text) > max_record_bytes;\\\\n      error_unauthorized boolean = not pg_catalog.has_any_column_privilege('authenticated', entity_, 'SELECT');\\\\n\\\\n      errors text[] = case\\\\n        when error_record_exceeds_max_size then array['Error 413: Payload Too Large']\\\\n        else '{}'::text[]\\\\n      end;\\\\n    begin\\\\n\\\\n      -- The 'authenticated' user does not have SELECT permission on any of the columns for the entity_\\\\n      if error_unauthorized is true then\\\\n        return (\\\\n          null,\\\\n          null,\\\\n          visible_to_user_ids,\\\\n          array['Error 401: Unauthorized']\\\\n        )::realtime.wal_rls;\\\\n      end if;\\\\n\\\\n      -------------------------------\\\\n      -- Build Output JSONB Object --\\\\n      -------------------------------\\\\n      output = jsonb_build_object(\\\\n        'schema', wal ->> 'schema',\\\\n        'table', wal ->> 'table',\\\\n        'type', action,\\\\n        'commit_timestamp', (wal ->> 'timestamp')::tex