pe\\\\n        perform realtime.cast(filter.value, col_type);\\\\n      end loop;\\\\n\\\\n      -- Apply consistent order to filters so the unique constraint on\\\\n      -- (subscription_id, entity, filters) can't be tricked by a different filter order\\\\n      new.filters = coalesce(\\\\n        array_agg(f order by f.column_name, f.op, f.value),\\\\n        '{}'\\\\n      ) from unnest(new.filters) f;\\\\n\\\\n    return new;\\\\n  end;\\\\n  $$;\\""}	execute "create or replace function realtime.subscription_check_filters()\\n      returns trigger\\n      language plpgsql\\n    as $$\\n    /*\\n    Validates that the user defined filters for a subscription:\\n    - refer to valid columns that the claimed role may access\\n    - values are coercable to the correct column type\\n    */\\n    declare\\n      col_names text[] = coalesce(\\n        array_agg(c.column_name order by c.ordinal_position),\\n        '{}'::text[]\\n      )\\n      from\\n        information_schema.columns c\\n      where\\n        format('%I.%I', c.table_schema, c.table_name)::regclass = new.entity\\n        and pg_catalog.has_column_privilege(\\n          (new.claims ->> 'role'),\\n          format('%I.%I', c.table_schema, c.table_name)::regclass,\\n          c.column_name,\\n          'SELECT'\\n        );\\n      filter realtime.user_defined_filter;\\n      col_type regtype;\\n    begin\\n      for filter in select * from unnest(new.filters) loop\\n        -- Filtered column is valid\\n        if not filter.column_name = any(col_names) then\\n          raise exception 'invalid column for filter %', filter.column_name;\\n        end if;\\n\\n        -- Type is sanitized and safe for string interpolation\\n        col_type = (\\n          select atttypid::regtype\\n          from pg_catalog.pg_attribute\\n          where attrelid = new.entity\\n            and attname = filter.column_name\\n        );\\n        if col_type is null then\\n          raise exception 'failed to lookup type for column %', filter.column_name;\\n        end if;\\n        -- raises an exception if value is not coercable to type\\n        perform realtime.cast(filter.value, col_type);\\n      end loop;\\n\\n      -- Apply consistent order to filters so the unique constraint on\\n      -- (subscription_id, entity, filters) can't be tricked by a different filter order\\n      new.filters = coalesce(\\n        array_agg(f order by f.column_name, f.op, f.value),\\n        '{}'\\n      ) from unnest(new.filters) f;\\n\\n    return new;\\n  end;\\n  $$;"	2025-12-12 13:29:24.102303
