ypeoid',\\\\n            realtime.cast(\\\\n                (x->'value') #>> '{}',\\\\n                coalesce(\\\\n                    (x->>'typeoid')::regtype, -- null when wal2json version <= 2.4\\\\n                    (x->>'type')::regtype\\\\n                )\\\\n            ),\\\\n            (pks ->> 'name') is not null,\\\\n            true\\\\n        )::realtime.wal_column\\\\n    )\\\\n    from\\\\n        jsonb_array_elements(wal -> 'columns') x\\\\n        left join jsonb_array_elements(wal -> 'pk') pks\\\\n            on (x ->> 'name') = (pks ->> 'name');\\\\n\\\\nold_columns =\\\\n    array_agg(\\\\n        (\\\\n            x->>'name',\\\\n            x->>'type',\\\\n            x->>'typeoid',\\\\n            realtime.cast(\\\\n                (x->'value') #>> '{}',\\\\n                coalesce(\\\\n                    (x->>'typeoid')::regtype, -- null when wal2json version <= 2.4\\\\n                    (x->>'type')::regtype\\\\n                )\\\\n            ),\\\\n            (pks ->> 'name') is not null,\\\\n            true\\\\n        )::realtime.wal_column\\\\n    )\\\\n    from\\\\n        jsonb_array_elements(wal -> 'identity') x\\\\n        left join jsonb_array_elements(wal -> 'pk') pks\\\\n            on (x ->> 'name') = (pks ->> 'name');\\\\n\\\\nfor working_role in select * from unnest(roles) loop\\\\n\\\\n    -- Update `is_selectable` for columns and old_columns\\\\n    columns =\\\\n        array_agg(\\\\n            (\\\\n                c.name,\\\\n                c.type_name,\\\\n                c.type_oid,\\\\n                c.value,\\\\n                c.is_pkey,\\\\n                pg_catalog.has_column_privilege(working_role, entity_, c.name, 'SELECT')\\\\n            )::realtime.wal_column\\\\n        )\\\\n        from\\\\n            unnest(columns) c;\\\\n\\\\n    old_columns =\\\\n            array_agg(\\\\n                (\\\\n                    c.name,\\\\n                    c.type_name,\\\\n                    c.type_oid,\\\\n                    c.value,\\\\n                    c.is_pkey,\\\\n                    pg_catalog.has_column_privilege(working_role, entity_, c.name, 'SELECT')\\\\n                )::realtime.wal_column\\\\n            )\\\\n            from\\\\n                unnest(old_columns) c;\\\\n\\\\n    if action <> 'DELETE' and count(1) = 0 from unnest(columns) c where c.is_pkey then\\\\n        return next (\\\\n            jsonb_build_object(\\\\n                'schema', wal ->> 'schema',\\\\n                'table', wal ->> 'table',\\\\n                'type', action\\\\n            ),\\\\n            is_rls_enabled,\\\\n            -- subscriptions is already filtered by entity\\\\n            (select array_agg(s.subscription_id) from unnest(subscriptions) as s where claims_role = working_role),\\\\n            array['Error 400: Bad Request, no primary key']\\\\n        )::realtime.wal_rls;\\\\n\\\\n  \\" <> ..."}	execute "create or replace function realtime.apply_rls(wal jsonb, max_record_bytes int = 1024 * 1024)\\nreturns setof realtime.wal_rls\\nlanguage plpgsql\\nvolatile\\nas $$\\ndeclare\\n-- Regclass of the table e.g. public.notes\\nentity_ regclass = (quote_ident(wal ->> 'schema') || '.' || quote_ident(wal ->> 'table'))::regclass;\\n\\n-- I, U, D, T: insert, update ...\\naction realtime.action = (\\n    case wal ->> 'action'\\n        when 'I' then 'INSERT'\\n        when 'U' then 'UPDATE'\\n        when 'D' then 'DELETE'\\n        else 'ERROR'\\n    end\\n);\\n\\n-- Is row level security enabled for the table\\nis_rls_enabled bool = relrowsecurity from pg_class where oid = entity_;\\n\\nsubscriptions realtime.subscription[] = array_agg(subs)\\n    from\\n        realtime.subscription subs\\n    where\\n        subs.entity = entity_;\\n\\n-- Subscription vars\\nroles regrole[] = array_agg(distinct us.claims_role::text)\\n    from\\n        unnest(subscriptions) us;\\n\\nworking_role regrole;\\nclaimed_role regrole;\\nclaims jsonb;\\n\\nsubscription_id uuid;\\nsubscription_has_access bool;\\nvisible_to_subscription_ids uuid[] = '{}';\\n\\n-- structured info for wal's columns\\ncolumns realtime.wal_column[];\\n-- previous identity values for update/delete\\nold_columns realtime.wal_column[];\\n\\nerror_record_exceeds_max_size boolean = octet_length(wal::text) > max_record_bytes;\\n\\n-- Primary jsonb output for record\\noutput jsonb;\\n\\nbegin\\nperform set_config('role', null, true);\\n\\ncolumns =\\n    array_agg(\\n        (\\n            x->>'name',\\n            x->>'type',\\n            x->>'typeoid',\\n            realtime.cast(\\n                (x->'value') #>> '{}',\\n                coalesce(\\n                    (x->>'typeoid')::regtype, -- null when wal2json version <= 2.4\\n                    (x->>'type')::regtype\\n                )\\n            ),\\n            (pks ->> 'name') is not null,\\n            true\\n        )::realtime.wal_column\\n    )\\n    from\\n        jsonb_array_elements(wal -> 'columns') x\\n        left join jsonb_array_elements(wal -> 'pk') pks\\n            on (x ->> 'name') = (pks ->> 'name');\\n\\nold_columns =\\n    array_agg(\\n        (\\n            x->>'name',\\n            x->>'type',\\n            x->>'typeoid',\\n            realtime.cast(\\n                (x->'value') #>> '{}',\\n                coalesce(\\n                    (x->>'typeoid')::regtype, -- null when wal2json version <= 2.4\\n                    (x->>'type')::regtype\\n                )\\n            ),\\n            (pks ->> 'name') is not null,\\n            true\\n        )::realtime.wal_column\\n    )\\n    from\\n        jsonb_array_elements(wal -> 'identity') x\\n        left join jsonb_array_elements(wal -> 'pk') pks\\n            on (x ->> 'name') = (pks ->> 'name');\\n\\nfor working_role in select * from unnest(roles) loop\\n\\n    -- Update `is_selectable` for columns and old_columns\\n    columns =\\n        array_agg(\\n            (\\n                c.name,\\n                c.type_name,\\n                c.type_oid,\\n                c.value,\\n                c.is_pkey,\\n                pg_catalog.has_column_privilege(working_role, entity_, c.name, 'SELECT')\\n            )::realtime.wal_column\\n        )\\n        from\\n            unnest(columns) c;\\n\\n    old_columns =\\n            array_agg(\\n                (\\n                    c.name,\\n                    c.type_name,\\n                    c.type_oid,\\n                    c.value,\\n                    c.is_pkey,\\n                    pg_catalog.has_column_privilege(working_role, entity_, c.name, 'SELECT')\\n                )::realtime.wal_column\\n            )\\n            from\\n                unnest(old_columns) c;\\n\\n    if action <> 'DELETE' and count(1) = 0 from unnest(columns) c where c.is_pkey then\\n        return next (\\n            jsonb_build_object(\\n                'schema', wal ->> 'schema',\\n                'table', wal ->> 'table',\\n                'type', action\\n            ),\\n            is_rls_enabled,\\n            -- subscriptions is already filtered by entity\\n            (select array_agg(s.subscription_id) from unnest(subscriptions) as s where claims_role = working_role),\\n            array['Error 400: Bad Request, no primary key']\\n        )::realtime.wal_rls;\\n\\n  " <> ...	2025-12-12 13:29:35.201929
